import './App.css';

import { useDispatch, useSelector } from 'react-redux';

function App() {
	const count = useSelector((state) => state.counter.users)
	const dispatch = useDispatch()


	return (
		<div className="App">
			{count.map(m => <div>{m.id} {m.username} {m.fullName}</div>)}

			<button onClick={() => { useDispatch() }}>click</button>
		</div>


	);
}



export default App;
